import React from "react";
import { Link } from "react-router-dom";

export default function CreateProjectButton() {
  return (
    <React.fragment>
      <Link to="ProjectForm.html" class="btn btn-lg btn-info">
        Create a Project
      </Link>
    </React.fragment>
  );
}
